import logo from './logo.svg';
import './App.css';
import Nav from './Nav';
import {BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import VocabCard from './VocabCard';
import { VocabWords } from './Vocab';
import VocabDictionary from './VocabDictionary';

function App() {
  return (
    <Router>
      <div>
        <Nav />
        <Switch>
          <Route path="/" exact component={Home}/>
          <Route path="/vocab" exact component={VocabDictionary}/>
        </Switch>
      </div>
    </Router>
  );
}

const Home = () => (
  <div>
      <header className="App-header">
        <div className="flexbox-row">
          {Object.values(VocabWords).map(vocabWord =>(
              <VocabCard kanji={vocabWord.kanji} characters={vocabWord.characters} romaji={vocabWord.romaji} part={vocabWord.part} meaning={vocabWord.meaning}/>
          ))}
        </div>
      </header>
  </div>
)

export default App;
